My First Sex Teacher - Britney Amber 

Release Date: February 28, 2011

Prof. Britney Amber isn't going to let Johnny play in the big game this weekend because his grades are horrible. Johnny pleads with his teacher but his desperate words aren't going to change her mind. What will change her mind is finding out if a rumor is true about the football team. He's more than happy to tell her whatever she wants, but Britney doesn't want a verbal response, she wants to see if he can split her uprights...
